INSERT INTO convenio VALUES ('5689', '56892013', '002', 2013, 'CONTRATO INTERADMINISTRATIVO BIM NRO. 002 DE 2013, CELEBRADO ENTRE LA UNIVERSIDAD DISTRITAL FRANCISCO JOSÉ DE CALDAS Y BANCO INMOBILIARIO DEL MUNICIPIO DE CHIA.', 'EL OBJETO DEL PRESENTE CONTRATO INTERADMINISTRATIVO ES DESARROLLAR Y EJECUTAR EL LEVANTAMIENTO TOPOGRÁFICO NECESARIO PARA LA ELABORACIÓN DE LOS REGISTROS TOPOGRÁFICOS DE LOS PREDIOS CON AFECTACIÓN VIAL Y RELACIONADOS EN LO CARTA DE INVITACIÓN O PRESENTAR PROPUESTA TÉCNICA Y ECONÓMICA EN LOS SIGUIENTES PROYECTOS: AMPLIACIÓN Y MEJORAMIENTO DE LO AVENIDA PRADILLA PRIMERA ETAPA DEL MUNICIPIO DE CHÍA; CONSTRUCCIÓN DE LA TRONCAL DEL PEAJE; Y CONSTRUCCIÓN DE LO TRONCAL DE CALDAICA. ENTIÉNDASE POR REGISTRO TOPOGRÁFICO LA REPRESENTACIÓN CARTOGRÁFICA (PLANO) QUE CONTIENE LOS LINDEROS, ÁREA DE TERRENO. ÁREA DE CONSTRUCCIÓN Y DETALLES CONSTRUCTIVOS QUE PRESENTA EL INMUEBLE, EL CUAL ES ELABORADO COMO INSUMO PARA EL PROCESO DE AVALÚOS DE LOS PREDIOS CON AFECTACIÓN VIAL Y OTROS QUE REQUIERA EL BANCO INMOBILIARIO ACORDADOS EN EL RESPECTIVO COMITÉ TÉCNICO EN COMPENSACIÓN A LOS PREDIOS QUE UNA VEZ REVISADOS NO REQUIEREN DE LEVANTAMIENTO.', 'BANCO INMOBILIARIO DEL MUNICIPIODE CHIA', 2910905850, '2013-10-18', '2015-04-30', 'TERMINADO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'NO DEFINIDA');
