INSERT INTO convenio VALUES ('5692', '56922013', 'S/N', 2013, 'CONVENIO MARCO DE COOPERACIÓN INTERINSTITUCIONAL ENTRE EL DEPARTAMENTO DEL TOLIMA Y LA UNIVERSIDAD DISTRTIAL FRANCISCO JOSE DE CALDAS.', 'EL PRESENTE CONVENIO INTERADMINISTRATIVO, DE ASOCIACIÓN Y COOPERACIÓN CELEBRADO ENTRE LA UNIVERSIDAD DISTRITAL FRANCISCO JOSE DE CALDAS Y SECRETARIA DEL AMBIENTE Y GESTIÓN DEL RIESGO DEL DEPARTAMENTO DEL TOLIMA, TIENE COMO OBJETO ANUAR ESFUERZOS PARA DESARROLLAR UNA ESTRATEGIA PARA IMPLEMENTAR ACCIONES ENCAMINADAS A QUE LA POBLACION DEL TOLIMA RECONOZCAN Y COMPRENDAN LOS RIESGOS A LOS QUE ESTA EXPUESTO EL AMBIENTE, POR TAL RAZON ES NECESARIA LA PARTICIPACION DE TODOS LOS ACTORES Y GRUPOS DE INTERES, QUE IMPLICAN INTERVENCIONES TECNICAS Y SOCIALES, EN EL ENTENDIMIENTO QUE LA GESTION DEL RIESGO SE CONSTITUYE EN UN ELEMENTO TRANSVERSAL DE LA ESTRATEGIA DE PLANIFICACION DEL DESARROLLOSOSTENIBLE DE UNA REGION. EN ESTE SENTIDO LA GESTION DEL RIESGO CONLLEVA CONOCIMIENTO DEL RIESGO, LA PARTICIPACION CIUDADANA Y DECISIONES POLITICAS Y ECONOMICAS, TENIENDO COMO LINEAS DE BASE LAS SIGUIENTES: 1. ASISTENCIA PARA IDENTIFICAR, EXPLICITAR Y PRECISAR AL CONJUNTO DE PROBLEMAS QUE PERMITIRA N SUBSTANCIAR LOS LINEAMIENTOS ESTRATEGICOS DE LA AGENDA QUE GUIARA LA GESTION INSTITUCUIONAL MEDIANTE LA FORMULACION, VALIDACION Y MONITOREO E INSTRUMENTACION DEL PLAN DE ACCION AMBIENTAL.   2. ASISTENCIA PARA DISEÑAR LOS PLANES OPERATIVOS QUE CONVIERTAN LOS LINEAMIENTOS ESTRATEGICOS EN ORIENTACIONES DIARIAS PARA LA GESTION INSTITUCIONAL AMBIENTAL.  3. ASISTENCIA PARA LA ARTICULACION DEL PLANEAMIENTO ESTRATEGICO-OPERATIVO CON LA FORMULACION PRESUPUESTARIA.  4. ASISTENCIA PARA CONSTRUIR LOS INDICADORES QUE PERMITAN MEDIR EL LOGRO DE LAS METAS ESTABLECIDAS EN LOS PLANES OPERATIVOS AMBIENTALES.  5. ASISTENCIA PARA EL DESARROLLO D UN TABLERO DE COMANDO PARA EL SEGUIMIENTO DE LA GESTION AMBIENTAL DEL DEPARTAMENTO DEL TOLIMA.', 'DEPARTAMENTO DEL TOLIMA', 0, '2013-11-11', '2015-11-10', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'NO DEFINIDA');
