INSERT INTO convenio VALUES ('5930', '59302015', '100', 2015, 'CONTRATO INTERADMINISTRATIVO NO 100 DE 2015 CELEBRADO ENTRE EL MUNICIPIO DE CÁQUEZA Y LA UNIVERSIDAD DISTRITAL FRANCISCO JOSE DE CALDAS', 'INTERVENTORIA TECNICA, ADMINISTRATIVA, FINANCIERA Y LEGAL PARA LA CONSTRUCCION PLACA HUELLAS EN LAS VÍAS: LA BASCULA - COLEGIO DE RINCÓN GRANDE, ESCUELA PALO GRANDE, LA HOYA DEL AGUARDIENTE, EL TANQUE DE MOYAS, MOYAS, GIRON DE BLANCOS EN EL MUNICIPIO DE CÁQUEZA', 'MUNICIPIO DE CAQUEZÁ', 0, '2015-06-24', '2015-12-23', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'INTERVENTORÍA');
INSERT INTO convenio VALUES ('5934', '59342015', 'OS 1776', 2015, 'ORDEN DE SERVICIO 1776 DE 2015 UNODC / UDFJC', 'SUMINISTRAR LOS SERVICIOS PARA ADELANTAR EL ESTUDIO TAXONÓMICO DE 100 MUESTRAS BOTÁNICAS RECOLECTADAS EN LOS PRINCIPALES NÚCLEOS DE PRODUCCIÓN DE MARIHUANA EN COLOMBIA E IDENTIFICAR LA ESPECIE Y LA VARIEDAD A LA QUE PERTENECE', 'OFICINA DE LAS NACIONES UNIDAS CONTRA LA DROGA Y EL DELITO UNODC', 2910906138, '2015-10-22', '2016-02-05', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'SERVICIOS ESPECIALIZADOS');
INSERT INTO convenio VALUES ('5968', '59682016', 'RETIE 2016', 2016, 'CERTIFICACIÓN DE COMPETENCIAS PROFESIONALES RETIE 2016', 'DESARROLLAR LA EVALUACIÓN DE LA COMPETENCIA TÉCNICA TANTO PARA INSPECTORES Y DIRECTORES TÉCNICOS DE ORGANISMOS DE INSPECCIÓN, COMO DE OTRAS COMPETENCIAS PROFESIONALES REQUERIDAS PARA EFECTOS DE REGLAMENTO TÉCNICO DE INSTALACIONES ELÉCTRICAS - RETIE', 'UNIVERSIDAD DISTRITAL FRANCISCO JOSÉ DE CALDAS - UD', 0, NULL, NULL, 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'PROGRAMA DE EDUCACIÓN CONTINUADA');
INSERT INTO convenio VALUES ('5970', '59702016', '002', 2016, 'CONVENIO DE COOPERACIÓN NO.002 DE 2016, CELEBRADO ENTRE LA CORPORACIÓN AUTONOMA REGIONAL DE LOS VALLES DEL SINU Y SAN JORGE -CVS Y LA UNIVERSIDAD DISTRITAL FRANCISCO JOSE DE CALDAS.', 'EL PRESENTE CONVENIO TIENE COMO OBJETO "FORTALECER EL EJERCICIO DE LA AUTORIDAD AMBIENTAL, MEDIANTE LA EVALUACIÓN  Y SEGUIMIENTO A LICENCIAS, PERMISOS, CONCESIONES Y AUTORIZACIONES AMBIENTALES PARA EL USO APROVECHAMIENTO O MOVILIZACIÓN DE LOS RECURSOS NATURALES RENOVABLES Y EL CONTROL DE ACTIVIDADES ILEGALES QUE AFECTEN O INCIDAN SOBRE EL AMBIENTE".', 'CORPORACIÓN AUTÓNOMA REGIONAL DE LOS VALLES DEL SINÚ Y DEL SAN JORGE - CVS', 0, '2016-02-04', '2016-12-03', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'ASESORÍA');
INSERT INTO convenio VALUES ('5973', '59732016', 'S/N', 2016, 'CONVENIO MARCO DE COOPERACIÓN SUSCRITO ENTRE FALCÓN ACADEMIA DE AVIACIÓN S.A.S. Y LA UNIVERSIDAD DISTRITAL FRANCISCO JOSE DE CALDAS.', 'AUNAR ESFUERZOS PARA ADELANTAR ACCIONES CONJUNTAS EN TEMAS DE INTERÉS RECIPROCO PARA CADA UNA DE LAS PARTES, EN LAS AREAS DE INVESTIGACIÓN, EXTENSIÓN, ASISTENCIA TÉCNICA, ADMINISTRATIVA Y ACADEMICA, RELACIONADAS CON LA "FORMACIÓN EN TIERRA Y VUELO PARA OPERACIÓN DE AERONAVES NO TRIPULADAS DENTRO DEL ESPACIO AEREO COLOMBIANO" Y EN TODAS LAS DEMAS FORMAS DE ACCION UNIVERSITARIA.', 'UNIVERSIDAD DISTRITAL FRANCISCO JOSÉ DE CALDAS - UD', 0, '2016-04-01', '2021-03-31', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'NO DEFINIDA');
INSERT INTO convenio VALUES ('5975', '59752016', '01', 2016, 'CONTRATO INTERADMINISTRATIVO NO.01 DE 2016 SUSCRITO ENTRE EL CONCEJO MUNICIPAL DE MADRID Y EL INSTITUTO DE EXTENSIÓN Y EDUCACIÓN PARA EL DESARROLLO HUMANO DE LA UNIVERSIDAD DISTRITAL FRANCISCO JOSÉ DE CALDAS', 'LA UNIVERSIDAD SE OBLIGA PARA CON EL CONCEJO A REALIZAR LA CAPACITACIÓN EN DERECHOS Y DEBERES DE LOS EMPLEADOS PÚBLICOS, GESTIÓN DE CALIDAD, DERECHOS Y DEBERES DE LOS CIUDADANOS , POS CONFLICTO, DISEÑO Y ELABORACIÓN  DE ENCUESTAS.', 'CONCEJO MUNICIPAL DE MADRID', 0, '2016-03-15', '2016-05-14', 'SUSCRITO', 'INSTITUTO DE EXTENSIÓN Y EDUCACIÓN NO FORMAL - IDEXUD', 'A', 'PROGRAMA PARA EL DESARROLLO HUMANO');
