INSERT INTO poliza VALUES (3, 'Poliza 3', 'POLIZA DE AMPARO PARA EL PAGO DE SALARIOS, PRESTACIONES SOCIALES E INDEMNIZACIONES POR EL CINCO ( 5% )DEL VALOR DEL CONTRATO POR EL TERMINO DE VIGENCIA DEL CONTRATO Y TRES (3)  MESES MAS.', '2016-10-01', 'CC39674528', false);
INSERT INTO poliza VALUES (4, 'Poliza 4', 'RESPONSABILIDAD CIVIL FRENTE A TERCEROS SERA EQUIVALENTE A UN DIEZ (10%) DEL VALOR TOTAL DEL CONTRATO, POR UNA VIGENCIA IGUAL A LA MISMA Y UN (1) AÑO MÁS.', '2016-10-01', 'CC39674528', true);
INSERT INTO poliza VALUES (5, 'Poliza 5', 'POLIZA DE ESTABILIDAD DE LA OBRA SERA EQUIVALENTE AL VEINTE (20%) DEL VALOR TOTAL DEL CONTRATO Y SU VIGENCIA NO PODRA SER INFERIOR A TRES (3) AÑOS CONTADOS A PARTIR DE LA FECHA DE SUSCRIPCIÓN DEL ACTA DE RECIBO DE LA OBRA.', '2016-10-01', 'CC39674528', true);
