INDEMNIDAD. EL CONTRATISTA será responsable y mantendrá indemne por cualquier concepto a la UNIVERSIDAD, incluidas cualquier acción, reclamación o demanda de cualquier naturaleza, derivada de daños y/o perjuicios causados a propiedades, a la vida o a la integridad personal de terceros  o de empleados, agentes o subcontratistas de cualquiera de las partes, que surjan como consecuencia directa o indirecta de actos, hechos u omisiones del CONTRATISTA, sus empleados, agentes o subcontratistas relacionadas con el objeto del presente Contrato o derivados de la ejecución del mismo. EL CONTRATISTA pagará todos los impuestos, tasas y similares que se deriven de la ejecución del contrato, de conformidad con la ley colombiana


EXCLUSION DE RELACION LABORAL: El contratista actuará por su cuenta, con absoluta autonomía y no está sometido a subordinación laboral por parte de la Universidad Distrital, y sus derechos se limitan de acuerdo con la naturaleza del contrato a exigir el cumplimiento de las obligaciones pactadas en el mismo, por lo que asume en su propio nombre y representación la responsabilidad por la vinculación del personal requerido en la ejecución de las actividades objeto del presente contrato y en consecuencia no existe vinculación laboral alguna entre la UNIVERSIDAD DISTRITAL y el CONTRATISTA y el personal que este último vincule en la realización de las actividades aquí pactadas. 


CLAUSULA PENAL PECUNIARIA: En caso de incumplimiento de la orden el contratista se obliga a pagar a la Universidad una suma equivalente al diez (10\\%) del valor total de la orden, a titulo de indemnización por los posibles perjuicios que le pueda ocasionar.


FORMAS DE TERMINACION DE LA ORDEN: TERMINACION Y LIQUIDACION. El presente contrato se dará por terminado en los siguientes eventos: 1) Por extinción del plazo pactado para la ejecución. 2) A solicitud debidamente sustentada interpuesta por una de las partes, por lo menos con un (1) mes de anticipación.  3) Por acuerdo bilateral. 4) Por caso fortuito o fuerza mayor debidamente comprobados. En los eventos numerados con 2, 3 y 4 se deberá suscribir acta donde conste tal hecho. Una vez terminado el contrato se procederá a su liquidación. 5) Por incumplimiento del objeto contractual. Para tal efecto el SUPERVISOR debe proyectar la liquidación dentro de los tres (3) meses siguientes  a  la  fecha  de  terminación,  anexando:  a) estado de cuenta; b) certificado de cumplimiento; y c) informe final de ejecución. La liquidación se efectuará de común acuerdo dentro de los tres (3) meses siguientes a la terminación del contrato. Si vencido este plazo el CONTRATISTA no se presenta a la liquidación o las partes no llegan a un acuerdo sobre el contenido de la misma, será practicada directa y unilateralmente por la UNIVERSIDAD o se adoptará por acto administrativo motivado, susceptible del recurso de reposición.


PARAGRAFO. El CONTRATISTA autoriza con la firma del presente contrato a la UNIVERSIDAD para que los valores que se adeuden a las entidades del Sistema de Seguridad Social integral o parafiscales sean descontados directamente del saldo a su favor. De no existir saldo a favor del CONTRATISTA se hará efectiva la garantía única constituida


INHABILIDADES E INCOMPATIBILIDADES: el proveedor al recibir la presente orden  declara no encontrarse incurso en las causales de inhabilidad o de incompatibilidad contempladas en el Estatuto de Contratación Publica, así como en las demás prohibiciones consagradas en la Ley y la Constitución. Además de la normatividad por la cual se rige la Universidad Distrital respecto a la contratación Acuerdo  Nº  03 de 2015, Resolución 262 del 2 de junio de 2015.

OBLIGACIONES: EL CONTRATISTA SE OBLIGA  A:

1) Aceptar íntegramente las condiciones y obligaciones del presente CONTRATO y aquellas que de conformidad con la ley deben tener los contratos celebrados con la Administración Pública.
2) Entregar el objeto del contrato de conformidad con lo ofrecido en su propuesta la cual es parte integrante del presente contrato, respetando en todo caso las condiciones mínimas.
3) Mantener los precios contenidos ofrecidos en la propuesta.
4) Será responsable ante las autoridades judiciales de los actos u omisiones en ejercicio de las obligaciones derivadas del presente contrato cuando con ellos cause perjuicios al contratante o a terceros.
5) Suministrar la mano de obra para realizar las actividades objeto del presente contrato cumpliendo con las especificaciones técnicas y administrativas indicadas por el Supervisor del Contrato

DOCUMENTOS. Forman parte integrante del contrato los siguientes documentos: cotización presentada por el CONTRATISTA y los documentos adjuntos presentados con la misma, Disponibilidad Presupuestal, actas y demás documentos que durante la ejecución del contrato se suscriban por las partes.

PERFECCIONAMIENTO Y EJECUCIÓN DEL CONTRATO. Para su perfeccionamiento se requiere la firma de las partes. Para su ejecución se requiere Registro Presupuestal y  aprobación de las respectivas pólizas.

