FORMAS DE TERMINACION DE LA ORDEN: TERMINACION Y LIQUIDACION. El presente contrato se dará por terminado en los siguientes eventos: 1) Por extinción del plazo pactado para la ejecución. 2) A solicitud debidamente sustentada interpuesta por una de las partes, por lo menos con un (1) mes de anticipación.  3) Por acuerdo bilateral. 4) Por caso fortuito o fuerza mayor debidamente comprobados. En los eventos numerados con 2, 3 y 4 se deberá suscribir acta donde conste tal hecho. Una vez terminado el contrato se procederá a su liquidación. 5) Por incumplimiento del objeto contractual. Para tal efecto el SUPERVISOR debe proyectar la liquidación dentro de los tres (3) meses siguientes  a  la  fecha  de  terminación,  anexando:  a) estado de cuenta; b) certificado de cumplimiento; y c) informe final de ejecución. La liquidación se efectuará de común acuerdo dentro de los tres (3) meses siguientes a la terminación del contrato. Si vencido este plazo el CONTRATISTA no se presenta a la liquidación o las partes no llegan a un acuerdo sobre el contenido de la misma, será practicada directa y unilateralmente por la UNIVERSIDAD o se adoptará por acto administrativo motivado, susceptible del recurso de reposición.


PARAGRAFO. El CONTRATISTA autoriza con la firma del presente contrato a la UNIVERSIDAD para que los valores que se adeuden a las entidades del Sistema de Seguridad Social integral o parafiscales sean descontados directamente del saldo a su favor. De no existir saldo a favor del CONTRATISTA se hará efectiva la garantía única constituida


